import './App.css';
import Web from "./componentas/Qr_web"
import Phone from "./componentas/Qr_phone"
import { Link } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <header className="App-header">
       <Link to={<Phone/>}>Phone</Link>
       <Link to={<Web/>}>Web</Link>
      </header>
    </div>
  );
}

export default App;
